import React from 'react';
import { makeStyles } from '@material-ui/core';
import { AppBar, Toolbar, Button, Select, MenuItem } from '@material-ui/core';
import { Card } from '@material-ui/core';
import { CloseIcon } from '../assets';

const useStyles = makeStyles((theme) => ({
    WindowHeader: {
        background: '#2A3E4C',
        borderRadius: '10px 10px 0px 0px',
        width: window.innerWidth - 160,
        position: 'static',
    },
    Title: {
        color: '#FFFFFF',        
    },
    TemplateDropdown: {
        broder: '2px solid white',
        position: 'fixed',
        right: '110px',
        display: 'flex'
    },
    CloseButton: {
        paddingLeft: '0px',
        paddingRight: '0px',
        width: '25px',
        height: '25px',
        border: '2px solid white',
    },
}));

const WindowHeader = () => {
    const classes = useStyles();
    return (
        <AppBar className={classes.WindowHeader}>
            <Toolbar>
                <div className={classes.Title}>
                    View Correspondence (2)
                </div>
                <div className={classes.TemplateDropdown}>
                    <div>
                        <Select>

                        </Select>
                    </div>
                    <div style={{ paddingTop: '10px', paddingBottom: '10px', paddingLeft: '20px' }}>
                        <Button className={classes.CloseButton}><CloseIcon/></Button>
                    </div>
                </div>
            </Toolbar>
        </AppBar>
    )
}

const ViewCorrespondencePage = () => {
    return (
        <div style = {{ paddingLeft: '80px', paddingTop: '80px' }}>
            <WindowHeader/>
        </div>
    );
}

export default ViewCorrespondencePage;
